import { jsx } from '@emotion/core'

import React, { Component } from 'react';
import ConnectedResultsTable from './ConnectedResultsTable';
import NewResultsForm from './NewResultsForm';
import RankedCurrenciesTable from './RankedCurrenciesTable';
import './App.css';

class App extends Component {

  render() {

    return (

    <div className="App">
    <div className ="App2"><h1> Welcome to HighYield4Me! </h1> </div>


let sectionStyle = (process.env.PUBLIC_URL + `/images/${image()}.png`) ;
let errorStyle =(process.env.PUBLIC_URL + `/eth.png`) ;


 <BodyClassName className="container" css={{ backgroundImage: `url("${errorState ? errorStyle : sectionStyle}")` }}>
</BodyClassName>

<p class="title">React</p>

        <ConnectedResultsTable />
        <NewResultsForm />
        <div className ="App3"> </div>
        <RankedCurrenciesTable />
      </div>
    );
  }
}
export default App;
